  var regex= /.*\/(\d+)/;
  var spaceId= window.location.href.match(regex)[1];



  return(
    <div> {spaceId}
      <div> {props.spaceData.spaces[spaceId]}</div>
    </div>
  )
}


const mapStateToProps = state => {
    return {
        spaceData: state.space,
    }
}

export default connect(
    mapStateToProps
)(SpaceDetail)
